import Post from './components/Post/Post';
import './Posts.css';
import posts from './postsData'; // Импортируем массив постов

const Posts = () => {
  return (
    <div className="posts">
      {posts.map((post) => (
        <Post key={post.id} post={post} />
      ))}
    </div>
  );
}

export default Posts;
